// Component to represent each individual card
class Card extends Component {
  render() {
    return (
      <React.Fragment>
        <img
          src={this.props.src}
          width="100"
          heigth="100"
          alt={this.props.alt}
        ></img>
      </React.Fragment>
    );
  }
}

export default Card;
